  false,\n\t\"url\": null,\n\t\"notes\": \"The database contains records pertaining
  to all sea turtles recovered by the NOAA Galveston Laboratory as the local representative
  of the Southeast Fisheries Science Centers Sea Turtle Stranding and Salvage Network
  STSSN.  The data includes morphometrics at the time of stranding, species and condition
  of the sea turtle at the time of stranding and documentation of tags present.  It
  also contains information on the geographic location of the stranding.\",\n\t\"license_title\":
